import React from "react";

const ContactPage = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100 p-6">
      <h1 className="text-4xl font-bold mb-6">Contactez-nous</h1>
      <p className="text-lg text-gray-600 mb-6">
        Prenez rendez-vous avec nos experts pour discuter de vos projets en data et intelligence artificielle.
      </p>
      <a href="mailto:contact@slimdata.com" className="bg-blue-600 hover:bg-blue-700 text-white py-3 px-6 rounded-full font-semibold shadow-md">
        Envoyer un email
      </a>
    </div>
  );
};

export default ContactPage;
